import React, { useState } from 'react';
import { 
  ChevronLeft, 
  ChevronRight, 
  ZoomIn, 
  X,
  Heart,
  Share2,
  Download
} from 'lucide-react';

const GalleryPage = () => {
  const [selectedImage, setSelectedImage] = useState(null);
  const [activeCategory, setActiveCategory] = useState('all');

  // Sample gallery data - replace with your actual images
  const categories = [
    { id: 'all', name: 'All Projects' },
    { id: 'workshops', name: 'Workshops' },
    { id: 'projects', name: 'Student Projects' },
    { id: 'events', name: 'Events' },
    { id: 'competitions', name: 'Competitions' }
  ];

  const galleryItems = [
    {
      id: 1,
      category: 'workshops',
      title: 'STEM Workshop 2024',
      description: 'Students learning about renewable energy',
      image: '/api/placeholder/600/400',
      date: 'March 2024'
    },
    {
      id: 2,
      category: 'projects',
      title: 'Solar Panel Project',
      description: 'Students installing solar panels',
      image: '/api/placeholder/600/400',
      date: 'February 2024'
    },
    // Add more gallery items as needed
  ];

  const filteredImages = activeCategory === 'all' 
    ? galleryItems 
    : galleryItems.filter(item => item.category === activeCategory);

  const ImageModal = ({ image, onClose }) => (
    <div className="fixed inset-0 bg-black bg-opacity-90 z-50 flex items-center justify-center p-4">
      <div className="relative max-w-4xl w-full">
        <button 
          onClick={onClose}
          className="absolute top-4 right-4 text-white hover:text-orange-500 transition-colors"
        >
          <X className="h-8 w-8" />
        </button>
        <img 
          src={image.image} 
          alt={image.title} 
          className="w-full h-auto rounded-lg"
        />
        <div className="absolute bottom-0 left-0 right-0 bg-gradient-to-t from-black to-transparent p-6">
          <h3 className="text-2xl font-bold text-white mb-2">{image.title}</h3>
          <p className="text-gray-200">{image.description}</p>
          <div className="flex gap-4 mt-4">
            <button className="text-white hover:text-orange-500 transition-colors">
              <Heart className="h-6 w-6" />
            </button>
            <button className="text-white hover:text-orange-500 transition-colors">
              <Share2 className="h-6 w-6" />
            </button>
            <button className="text-white hover:text-orange-500 transition-colors">
              <Download className="h-6 w-6" />
            </button>
          </div>
        </div>
      </div>
    </div>
  );

  return (
    <div className="min-h-screen bg-orange-50 py-16">
      <div className="container mx-auto px-4">
        <h1 className="text-4xl font-bold text-orange-800 text-center mb-12">
          Our Gallery
        </h1>

        {/* Category Filter */}
        <div className="flex flex-wrap justify-center gap-4 mb-12">
          {categories.map(category => (
            <button
              key={category.id}
              onClick={() => setActiveCategory(category.id)}
              className={`px-6 py-2 rounded-full transition-all duration-300 ${
                activeCategory === category.id 
                  ? 'bg-orange-500 text-white' 
                  : 'bg-white text-orange-700 hover:bg-orange-100'
              }`}
            >
              {category.name}
            </button>
          ))}
        </div>

        {/* Gallery Grid */}
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
          {filteredImages.map(item => (
            <div 
              key={item.id}
              className="relative group overflow-hidden rounded-xl shadow-lg"
            >
              <img 
                src={item.image} 
                alt={item.title}
                className="w-full h-64 object-cover transform group-hover:scale-110 transition-transform duration-500"
              />
              <div className="absolute inset-0 bg-gradient-to-t from-black via-transparent to-transparent opacity-0 group-hover:opacity-100 transition-opacity duration-300">
                <div className="absolute bottom-0 left-0 right-0 p-6">
                  <h3 className="text-xl font-bold text-white mb-2">{item.title}</h3>
                  <p className="text-gray-200 text-sm mb-4">{item.description}</p>
                  <button 
                    onClick={() => setSelectedImage(item)}
                    className="bg-orange-500 hover:bg-orange-600 text-white px-4 py-2 rounded-full flex items-center gap-2 text-sm"
                  >
                    <ZoomIn className="h-4 w-4" />
                    View Details
                  </button>
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>

      {/* Modal */}
      {selectedImage && (
        <ImageModal 
          image={selectedImage} 
          onClose={() => setSelectedImage(null)} 
        />
      )}
    </div>
  );
};

export default GalleryPage;
